import Router from 'json-server/lib/server/router';
import {BrowserRouter as router, Routes, Route} from 'react-router-dom'

function App() {
  return (
   <Router>
     <Routes>
       <Route path='/'>
         <Home />
       </Route>
     </Routes>
   </Router>
  );
}

export default App;
